	add("macguffin", "{\"term\":\"macguffin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Used by {{w|Alfred Hitchcock}}, formed as an invented Scottish surname; see {{w|MacGuffi. History_and_use}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A plot element or other device used to catch the audience\u0027s attention and maintain suspense, but whose exact nature has fairly little influence over the storyline\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, w:Steven Steven Spielberg, Lester D. Friedman, Brent Notbohm, \u0027Steven Spielberg: Interviews\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot; ... But we wound up realizing you really can\u0027t top yourself. You just tell a different story and hope the new \u0027\u0027MacGuffin\u0027\u0027 is as compelling as the last \u0027\u0027MacGuffin\u0027\u0027.\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, w:Thomas Thomas M. Disch, \u0027On SF\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A paleontologist lately returned from an expedition to Wyoming, where he unearthed the bones of the first brontosaurus (and supplied guns to the Indians on behalf of the Foreign Office, which had succeeded in its policy of balkanizing the North American continent) Mallory comes into possession of the \u0027\u0027MacGuffin\u0027\u0027 during a Derby Day encounter with Byron\u0027s daughter (and Babbage\u0027s protégée) Ada. Thereafter he is hounded by a whole rogue\u0027s gallery of villains bent on reclaiming the \u0027\u0027MacGuffin\", \"priority\":5}]}, \"synonyms\":{}}");

