	add("mackinaw", "{\"term\":\"mackinaw\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Ojibwe\"], \"text\":\"Representing an earlier colloquial pronunciation of \u0027\u0027 a strait between Lake Huron and Lake Michigan, an island in the strait, and an important trading-post on the island; ultimately from Ojibwe \u0027mishinii-makinaang\u0027 (at the place of many snapping turtles)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A heavy, woolen cloth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A blanket made of wool, formerly distributed to the Amerindians by the U.S. government\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A flat-bottomed cargo boat; mackinaw boat\", \"priority\":3}]}, \"synonyms\":{}}");

