	add("macra", "{\"term\":\"macra\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From the Ancient greek (to 1453) \u0027μακρά\u0027 neuter plural form of \u0027μακρός\u0027 (long)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1986\u0027\u0027: Peter V. Jones and Keith C. Sidwell, \u0027Reading Latin: Grammar, vocabulary and exercises\u0027, Introduction — \u0027General notes\u0027 (note 1), page 2 (22\u0026lt;sup\u0026gt;nd\u0026lt;/sup\u0026gt; printing (2007); Cambridge University Press; ISBN 9780521286220\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"All vowels are pronounced \u0027short\u0027 unless marked with a ¯ (macron) over them. So observe different vowel length of ‘\u0027i\u0027’ in, e.g., \u0027fīlia\u0027, etc. It may be helpful, but is not essential, to mark \u0027\u0027macra\u0027\u0027 in your exercises\", \"priority\":2}]}, \"synonyms\":{}}");

